    import java.util.*;    import java.io.*;         public class tshirtsFromSponsor {        public static void main(String args[]) {            Scanner sc = new Scanner(System.in);            int A[] = new int[5];            for(int i = 0; i < 5; i++)                A[i] = sc.nextInt();            int k = sc.nextInt();            ArrayList<String> S = new ArrayList<>();            S.add("S");            S.add("M");            S.add("L");            S.add("XL");            S.add("XXL");                 for(int i = 0; i < k; i++){                String st = sc.next();                if(A[S.indexOf(st)] != 0){                    System.out.println(st);                    A[S.indexOf(st)]--;                } else {                    int p = 1;                    while(true){                        if(S.indexOf(st) + p < 5 && A[S.indexOf(st) + p] != 0){                            System.out.println(S.get(S.indexOf(st) + p));                            A[S.indexOf(st) + p]--;                            break;                        } else if(S.indexOf(st) - p >= 0 && A[S.indexOf(st) - p] != 0){                            System.out.println(S.get(S.indexOf(st) - p));                            A[S.indexOf(st) - p]--;                            break;                        } else                            p++;                    }                }            }        }    }
